import React from 'react'
import { Icon, Label, Menu, Table, Container, Tab } from 'semantic-ui-react'

const TableData = ({stats, events}) => {
    // let data = null;
    // if(stats.length) data = stats[0]
    // else data= {"date":"2017-01-01T03:30:00.001Z","hour":0,"impressions":10746,"clicks":23,"revenue":"64.9215630000000","poi_id":3}

    const displayData = () => {
        if(stats){
            stats.map( (data, i) => {
                console.log(data[i]["date"])
                return(
                    <Table.Row key={i}>
                                <Table.Cell>{data[i]["date"]}</Table.Cell>
                                <Table.Cell>{data[i]["hour"]}</Table.Cell>
                                <Table.Cell>{data[i]["impressions"]}</Table.Cell>
                                <Table.Cell>{data[i]["clicks"]}</Table.Cell>
                                <Table.Cell>{data[i]["revenue"]}</Table.Cell>
                                <Table.Cell>{data[i]["poi_id"]}</Table.Cell>
                    </Table.Row>
                )
            });
        }
        return 
    }

    return (
        <Container>
              <Table striped>
                <Table.Header>
                    <Table.Row>
                        <Table.HeaderCell>Date</Table.HeaderCell>
                        <Table.HeaderCell>Hour</Table.HeaderCell>
                        <Table.HeaderCell>Impressions</Table.HeaderCell>
                        <Table.HeaderCell>Clicks</Table.HeaderCell>
                        <Table.HeaderCell>Revenue</Table.HeaderCell>
                        <Table.HeaderCell>POI ID</Table.HeaderCell>
                    </Table.Row>
                </Table.Header>

                <Table.Body>
                    {displayData()}
                </Table.Body>
            </Table>
        </Container>
    );
}

export default TableData;
